const iconv = require('iconv-lite');
const express = require('express');
const my_param = require('./jm');
const bodyParser = require('body-parser');
const app = express();

app.use(bodyParser.json());
app.use(bodyParser.urlencoded());


app.get('/', function (req, res) {
    // params = req.body;
    // console.log(params);
    params = {city1: "北京", city2: "上海", city3: "杭州", type: "HOUR", startTime: "2020-04-16 12:00:00",endTime:"2020-04-17 15:56:34"};
    let param = my_param.getParam(params);
    console.log(param);


    res.send(param);
});

app.post('/', function (req, res) {
    let base64 = new my_param.Base64();
    // params = "";
    params = req.body["param"];
    // params = iconv.decode(params, 'utf8');
    // console.log(params);
    // console.log(typeof params);

    data = my_param.decryptData(params);
    console.log(data);
    data2 = base64.decode(data);
    console.log(data2);

    res.send(data2);
});


app.listen(3000, () => {
    console.log('开启服务， 端口3000')
});

